import React from 'react'

const Score = ({redSrore=0, blueScore=0}) => {
    return (
        <div className='score-board'>
            <table>
                <tr>
                    <th>Red</th>
                    <th>Blue</th>
                </tr>
                <tr>
                    <td>
                        {redSrore}
                    </td>
                    <td>{blueScore}</td>
                </tr>
            </table>
        </div>
    )
}

export default Score;
